INSERT INTO lingwhaat.pronunciation SET name = "herbata", ipa = "{{quote-web|1=pl|author=|title=RODZAJE HERBAT: Od liścia do filiżanki|work=demmers.pl|url=https://demmers.pl/rodzaje-herbaty|archiveurl=https://web.archive.org/web/20240125174112/https://demmers.pl/rodzaje-herbaty|archivedate=25 Jan 2024|date=13 Sep 2023|accessdate=25 Jan 2024|text=Tradycyjna '''herbata''' to napar przygotowywany z liści lub pąków krzewu herbacianego (''Camellia sinensis''). Gatunek wywodzący się z Chin jest obecnie uprawiany w dziesiątkach krajów, stając się jedną z najważniejszych i najbardziej rozpowszechnionych roślin uprawnych na Ziemi.|t=Traditional '''tea''' is an infusion prepared from the leaves or buds of the '''tea plant''' (''Camellia sinensis''). The species, which originated in China, is now cultivated in dozens of countries, becoming one of the most important and widespread crops on Earth;{{quote-web|1=pl|author=Anna Rokicka-Żuk|title=Z tą herbatą schudniesz bez trudu. Pij na spalanie tłuszczu z brzucha i zobacz, ile kilogramów możesz stracić|work=szczecinek.naszemiasto.pl|url=https://szczecinek.naszemiasto.pl/z-ta-herbata-schudniesz-bez-trudu-pij-na-spalanie-tluszczu/ar/c14-7412082|archiveurl=https://web.archive.org/web/20240125182106/https://szczecinek.naszemiasto.pl/z-ta-herbata-schudniesz-bez-trudu-pij-na-spalanie-tluszczu/ar/c14-7412082|archivedate=25 Jan 2024|date=25 Oct 2023|accessdate=25 Jan 2024|text=Rodzaje '''herbaty''' chińskiej różni sposób zbioru, który często odbywa się o odmiennych porach roku i z określonych miejsc na gałązce, a następnie specjalny sposób przetwarzania z zastosowaniem wielu etapów. Każda z nich występuje też w licznych wersjach, często diametralnie różniących się smakiem. Nie tylko przygotowuje się z nich napar, ale także spożywa wraz z napojem, jak ma to miejsce w przypadku zielonej '''herbaty''' matcha. Obróbka liści '''herbaty''' wpływa nie tylko na wygląd i smak tego, co zaparzamy, ale również na właściwości uzyskanego napoju.|t=The types of Chinese '''tea''' differ in the way they are harvested, which is often at different times of the year and from specific locations on the branch, followed by special processing with multiple steps. Each of them also comes in numerous versions, often differing dramatically in taste. They are not only made into an infusion but also consumed together with the drink, as is the case with matcha. The processing of '''tea leaves''' affects not only the appearance and taste of what we brew but also the properties of the resulting beverage;{{quote-web|1=pl|author=Klaudia Katarzyńska|title=Herbata z miodem, cytryną i imbirem. PRZEPIS jest prosty, ale prawie wszyscy robią ten błąd|work=gotowanie.dziennik.pl|url=https://gotowanie.dziennik.pl/przepisy/artykuly/9325205,herbata-z-miodem-cytryna-i-imbirem-przepis-jest-prosty-ale-prawie-w.html|archiveurl=https://web.archive.org/web/20240125182755/https://gotowanie.dziennik.pl/przepisy/artykuly/9325205,herbata-z-miodem-cytryna-i-imbirem-przepis-jest-prosty-ale-prawie-w.html|archivedate=25 Jan 2024|date=23 Oct 2023|accessdate=25 Jan 2024|text=Jesienią i zimą sięgamy po domowe sposoby na podniesienie odporności. Jednym z nich jest picie '''herbaty''' z dodatkiem cytryny, miodu i imbiru. Każdy z tych składników pomoże również na łagodzenie objawów przeziębienia. Pamiętajmy jednak o kilku zasadach, by cytryna, miód i imbir mogły jak najlepiej zadziałać.|t=In autumn and winter, we turn to home remedies to boost our immunity. One of them is to drink '''tea''' with lemon, honey, and ginger. Each of these ingredients will also help relieve cold symptoms. However, we should remember a few rules so that lemon, honey, and ginger can work best;";
