INSERT INTO lingwhaat.pronunciation SET name = "ある", ipa = "Various combinations with the term have certain meaning;Used after {{ja-r|と|pos=quotation particle}}, meaning {{m-g|to [[say]]; to give [[information]]}}, similar to {{ja-r|と いう;;Used in the form {{ja-r|[[と]] あって}}, meaning {{m-g|[[due to]] (the [[situation]] or [[result]])}}, which is more formal than {{ja-r|だから;;Used in the form {{ja-r|[[だけ]] ある}} or {{ja-r|だけ の [[こと]] は ある}}, expressing that a [[suitable]] [[state]] or [[result]] can be [[obtain]]ed, which roughly translates as {{m-g|as [[expect]]ed; it is no [[surprise]];;Used in the form {{ja-r|[[こと]] が ある}}, indicating a [[possible]] [[reaction]] to or [[result]] from a [[situation]], or referring to [[experience]], literally {{m-g|There exists that ...;;;Used in the form {{ja-r|[[に]] あって}}, meaning {{m-g|[[in terms of]]; [[within]] the [[context]] of;;Used in the form {{ja-r|[[に]] [[する|して]] ある}}, indicating that someone is [[intentionally]] [[consider]]ing something as if it were a certain way, even if it is not actually ;;";
