INSERT INTO lingwhaat.pronunciation SET name = "愛", ipa = "{{zh-x|愛 而 不見、搔-首 踟躕。|'''Loving''' yet not seeing her, I scratch my head, and walk back and forth in perplexity.|ref=Shijin;{{zh-x|仁 者 愛 人，有禮 者 敬 人。愛 人 者 人 恆 愛 之，敬 人 者 人 恆 敬 之。|A benevolent person '''loves''' others. A person of propriety shows respect to others. Those who '''love''' others are constantly '''loved''' by them. Those who respect others are constantly respected by them.|ref=Mencius-L|tr=Rén zhě '''ài''' rén, yǒulǐ zhě jìng rén. '''Ài''' rén zhě rén héng '''ài''' zhī, jìng rén zhě rén héng jìng zhī;{{zh-x|吾 至 愛 汝，即 此 愛 汝 一 念，使 吾 勇於 就 死 也。|I '''love''' you deeply, and it is this single thought of '''loving''' you that enables me to take courage in the face of imminent death.|CL|ref=1911, [[w:Lin Juemin|Lin Juemin]], ''Farewell Letter to Yiying'' ({{lang|zh|《[[s:zh:與妻訣別書|與妻訣別書]]》}})|tr=Wú zhì '''ài''' rǔ, jí cǐ '''ài''' rǔ yī niàn, shǐ wú yǒngyú jiù sǐ yě;{{zh-x|夏 不 衣{yì} 裘，非 愛 裘 也，暖 有餘 也。|One does not wear fur in summer not because he '''treasures''' fur, but because it is already more than warm.|ref=Lvshi Chunqiu|tr=Xià bù yì qiú, fēi '''ài''' qiú yě, nuǎn yǒuyú yě;{{zh-x|願 大{dài}王 毋 愛 財物。|Might I suggest that Your Majesty be not '''keenly attached''' to the riches.|ref=Shiji|tr=Yuàn dàiwáng wú '''ài''' cáiwù;{{zh-x|愛 之 欲 其 生，惡{wù} 之 欲 其 死。|You love a man and wish him to live; you hate him and wish him to die.|ref=Analects|tr='''Ài''' zhī yù qí shēng, wù zhī yù qí sǐ;{{zh-x|予{yú} 獨 愛 蓮 之 出.淤泥.而.不.染。|What I '''like''' about the lotus is the fact that it grows out of pond dregs yet is not caught in the filth.|CL|ref=1063, [[w:Zhou Dunyi|Zhou Dunyi]], {{lang|zh|《[[s:zh:愛蓮說|愛蓮說]]》}} (''On the Love for the Lotus'')|tr=Yú dú '''ài''' lián zhī chū yūní ér bù rǎn;{{zh-x|^申-生 不敢 愛 其 死。|I, [[w:Prince Shensheng of Jin|Shensheng]], do not presume to '''grudge''' dying.|ref=Liji-L|tr=Shēnshēng bùgǎn '''ài''' qí sǐ;{{zh-x|^齊國 雖 褊小，吾 何 愛 一 牛？|But though Qi be a small and narrow State, how should I '''grudge''' one ox?|ref=Mencius|tr=Qíguó suī biǎnxiǎo, wú hé '''ài''' yī niú;{{zh-x|獨 子 愛 其 死 乎？|Do you alone '''begrudge''' your death?|ref=Fayan-B|tr=Dú zǐ '''ài''' qí sǐ hū;{{zh-x|世上 決 沒有 無緣無故 的 愛，也 沒有 無緣無故 的 恨。|There is absolutely no such thing in the world as '''love''' or hatred with out reason or cause.|ref=MaoYanan|tr=Shìshàng jué méiyǒu wúyuánwúgù de '''ài''', yě méiyǒu wúyuánwúgù de hèn;{{zh-x|快樂 就 係 @&amp;#032; 想 愛 麼個 就 得著[着]{tó}||H|ref={{rfdate|zh}}, {{lang|zh|饒瑞軍}} (lyrics), {{w|Tetsurō Oda}} (music), {{lang|zh|《快樂希望》}} (Hakka version of ''{{w|Yume Ippai}}''), performed by {{lang|zh|龔心怡}}|tr=khoai-lo̍k chhiu he sióng '''oi''' mak-ke chhiu tet-t�;{{quote-book|yue|year=1907|title=Cantonese Made Easy|edition=third|author=J. Dyer Ball|location=Singapore|publisher=Kelly &amp; Walsh, Limited|page=16|pageurl=https://books.google.ca/books?id=abp-AAAAIAAJ&amp;pg=PA1;;{{zh-x|愛 而 不 見{xiàn}|She '''hides''' herself and does not appear.|CL|ref={{circa|7th century {{BC}}}}, ''[[w:Shijing|Shijing]]'', {{lang|zh|《邶風‧靜女》}}|tr='''ài''' ér bù xià;";
