INSERT INTO lingwhaat.pronunciation SET name = "漢", ipa = "{{zh-x|決 ^汝 ^漢，排 ^淮 ^泗，而 注 之 ^江。|He opened a vent also for the Ru and '''Han''', and regulated the course of the Huai and Si, so that they all flowed into the Jiang.|ref=Menciu;{{zh-x|維 天 有 漢、監 亦 有 光。|There is the '''milky way''' in heaven, which looks down on us in light.|CL|ref=Shijin;{{zh-x|問 今 是 何 世，乃 不知 有 ^漢，無論 ^魏 ^晉。|When asking about the name of the current dynasty, it became apparent that they did not know about the '''Han''' Dynasty, much less the Wei or Jin Dynasties.|ref='''421''', {{w|Tao Yuanming}}, {{lw|zh|桃花源記}} (''[[s:Translation:The Peach Blossom Spring|The Peach Blossom Spring]]'')|C;{{zh-x|總 期 人民 安堵，海宇 乂安，仍 合 ^滿、^漢、^蒙、^回、^藏{zàng} 五 族 完全 領土 為{wéi} 一 大 ^中華.^民國。|[S]uch that peace may be assured and restored to the people and country, all while retaining the complete territorial integrity of the lands of the five races—Manchu, '''Han''', Mongol, Hui, and Tibetan—which shall combine to form a great Republic of China.|ref='''Feb 1912''', {{lang|zh|[[s:zh:清室退位詔書|清室退位詔書]]}} ({{w|Imperial Edict of the Abdication of the Qing Emperor}})|C;{{zh-x|^邵 舊 鄙 ^崔 ^暹 無 學術，言論 之 際，遂 云 ^暹 無 所 知解。^宣-武 還 以 ^邵 言 告 ^暹，並 道「此 漢 不可 親近。」^暹 頗 銜 之。||ref=Beish;";
INSERT INTO lingwhaat.pronunciation SET name = "疒", ipa = "{{zh-x|貞 王 其 疒{jí} 目。&lt;br/&gt;貞 王 弗 疒{jí} 目。|To divine: will the King's eye '''fall ill'''? To divine: will the King's eye not '''fall ill'''?|CL-PC|ref={{w|zh:甲骨文合集|合}}00456�;{{zh-x|w:zh:婦好\帚{Fù}.^好 弗 疒{jí} 齒。|Will Lady Hao's teeth not '''fall ill'''?|CL-PC|ref={{w|zh:甲骨文合集|合}}00773�;";
